import React, { FC, useCallback } from 'react';
import './styles.css';
import Button from '../button';
import { useAppSelector, useAppDispatch } from '../../app/hooks';
import {
    selectProjectText,
    selectExpandText,
    selectCollapseText,
    expand,
    collapse,
    addProject
} from '../../slice/menuSlice';


export interface ButtonProperties {
}

const Menu: FC<ButtonProperties> = () => {
    const projectText = useAppSelector(selectProjectText);
    const expandText = useAppSelector(selectExpandText);
    const collapseText = useAppSelector(selectCollapseText);

    return (
        <div className="menu">
            <Button
                text={projectText}
                onClick={() => useAppDispatch(addProject())}
                type='primary'
            />
            <Button
                text={expandText}
                onClick={() => useAppDispatch(expand())}
                type='secondary'
            />
            <Button
                text={collapseText}
                onClick={() => useAppDispatch(collapse())}
                type='secondary'
            />
        </div>
    );
};

export default Menu;
